import React from "react";
import "./FiltrosCocheras.css";

const FiltrosCocheras = () => {
    return (
        <div className="filters">
            <select className="filter-select">
                <option value="">Ubicación</option>
                <option value="subterraneo-edificio-a">Subterráneo-Edificio A</option>
                <option value="superficie-edificio-b">Superficie-Edificio B</option>
            </select>
            <select className="filter-select">
                <option value="">Estado</option>
                <option value="disponible">Disponible</option>
                <option value="ocupada">Ocupada</option>
            </select>
            <input
                type="text"
                className="search-input"
                placeholder="Buscar por ID, número o propietario"
            />
        </div>
    );
};

export default FiltrosCocheras;
